/* eslint-disable no-unused-vars */
/* eslint-disable no-undef */
// import  } from 'react';
import { Link } from "react-router-dom";
import { Box, Grid } from "@mui/material";
import { MachineList } from "./machinelist/index.js";
import { useState } from "react";
import { Route, Routes } from "react-router-dom";
import CssBaseline from "@mui/material/CssBaseline";
import Dashboard_2 from "./dashboard/Dashboard.js";
import Toolbar from "@mui/material/Toolbar";

// import { MachineInfoPage } from "./machinelist/machineinfo/MachineinfoPage.js";
import NavBar from "./NavBar.js";
import SideBar from "./SideBar.js";
import NotFound from "../404.js";

export default function Dashboard(props) {
  // const [machineData, setMachineData] = useState([]);
  const [open, setOpen] = useState(true);

  return (
    // <DashboardLayout title={""} machineData={machineDumbData}>

    <Box sx={{ display: "flex", height: "100vh" }}>
      <SideBar open={open} setOpen={setOpen} />
      <CssBaseline />
      <Grid
        container
        sx={{
          flex: 1,
          display: "flex",
          flexDirection: "column",
        }}
      >
        <NavBar open={open} setOpen={setOpen} />
        <Toolbar />
        <Box sx={{ flex: 1, overflow: "auto", marginTop: "2%" }}>
          <Routes>
            <Route exact path="/d" element={<Dashboard_2 />} />
            <Route exact path="/" element={<MachineList />} />
            {/* <Route
        path="/machines/:ID"
        element={<MachineInfoPage machineData={machineDumbData} />}
      /> */}
            <Route path="/*" element={<NotFound />} />
          </Routes>
        </Box>
      </Grid>
    </Box>
    // </DashboardLayout>
  );
}
